import React from 'react';
//import axios from "axios";

export default class ArchivePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            archives:[],
        };
    }

    componentDidMount() {
        fetch('/listarchives')
          .then(response => response.json())
          .then(json => this.setState({ archives: json }));
      }


    render() {

        return(
            <div>
                <h1>ARCHIVES PAGE</h1>
                <table class="table table-striped">
                            <thead>
                            <tr>
                                <th scope="col">Name</th>
                                <th scope="col">Time</th> 
                                <th scope="col">Status</th>
                                <th scope="col">Archive ID</th> 
                            </tr>
                            </thead>
                </table>

                {

                this.state.archives.length === 0
                    ? 'Loading users...'
                    : 
                    this.state.archives.map(archive => (
                        <table>
                            <tbody>
                                <tr>
                                    <td>{archive.name}</td>
                                    <td>{archive.duration} seconds</td>
                                    <td>{archive.status}</td>
                                    <td>{archive.id}</td>

                                </tr>
                            </tbody>
                        </table>

                    ))
                }

            </div>
        )
    };
};
